const todoData = [
  {
    id: 1,
    text: "do not check this box",
    completed: false
  },
  {
    id: 2,
    text: "what to do now?",
    completed: true
  },
  {
    id: 3,
    text: "go to class",
    completed: false
  },
  {
    id: 4,
    text: "do some assignments",
    completed: false
  },
  {
    id: 5,
    text: "go to home",
    completed: true
  }
];
export default todoData;
